import Button from './Button'

const Header = () => {

    const onClick = () => {
        console.log('Click')
    }

    return (
        <header className='header'>
            <h1>Enigma Machine</h1>
            <Button color='green'text='Hello' onClick={onClick} />
            <Button color='blue'text='Hello 1'/>
        </header>
    )
}



export default Header
